import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';


ReactDOM.render(
    <>
        <App />
    </>
    ,
    document.getElementById('root')
)

//1st Case

const fullname = ['sultan', 'akhter'];
const bio = [1, ...fullname, 26, 'male'];

console.log(fullname);
console.log(bio);

//2nd Case

var shooterGames = ['Far Cry', 'PUBG', 'COD'];
var racingGames = ['Need for speed', 'Burn out'];
var games = [...shooterGames, ...racingGames];

console.log(games);

//3rd Case

var shooterGames = ['Far Cry', 'PUBG', 'COD'];
var [first, ...remain] = shooterGames;
console.log(first);
console.log(remain);

//Embed one object into another

const fullName = {
    fname: 'Sultan',
    lname: 'Akhter',
};

const biodata = {
    id: 1,
    ...fullName,
    age: 26,
    gender: 'Male',
}

console.log(biodata);
